import './App.css'
import LoginPage from './LoginPage';
import FireStationPage from './FireStationPage';
import MainStatusPage from './MainStatusPage';
import RegisterPage from './RegisterPage';
import { BrowserRouter as Route, Router, Switch} from "react-router-dom"


function App() {
  return (
    <Router>
      <Switch>
      <Route exact path="/" component={LoginPage} />
      <Route exact path="/RegisterPage" component={RegisterPage} />
      <Route exact path="/MainStatusPage" component={MainStatusPage} />
      <Route exact path="/FireStationPage" component={FireStationPage} />
      </Switch>
    </Router>
  );
}

export default App;
